import React from 'react';
import { useRef, useState } from 'react';
import { toAbsoluteUrl } from '../../_helpers/AssetsHelpers';
import Header from '../Layout/Header';
import './css/projects.scss';
import { Link } from "react-router-dom";

function ProjectsTwo(props) {
    const [slug, setSlug] = useState("/projects");
    return (
        <div className="projects_div">
            <Header />

            <div className="section_one">
                <video
                    autoPlay
                    loop
                    muted
                // style={{
                //     position: "relative",
                //     width: "1440px",
                //     left: "50%",
                //     top: "50%",
                //     height: "900px",
                //     objectFit: "cover",
                //     transform: "translate(-50%,-50%)",
                //     // opacity: 0.5
                //     // zIndex: "-1"
                // }}
                >
                    <source src={toAbsoluteUrl("/media/video/video_2.mp4")} type="video/mp4"></source>
                </video>
            </div>

            <div className="section_two">
                <div className="nav_button_div">
                    <div className="left_nav_span ">
                        <img className="left_nav_img" src={`${toAbsoluteUrl(`/media/icons/arrow-left-grey.svg`)}`} alt="Left" />
                        <Link to="/projects" > <span className="left_nav_label">Back to Previous</span></Link>
                    </div>
                    <div className="right_nav_span">
                        <Link to="/projects-three" >  <span className="right_nav_label">Next Project</span></Link>
                        <img className="right_nav_img" src={`${toAbsoluteUrl(`/media/icons/arrow-right-grey.svg`)}`} alt="Right" />
                    </div>
                </div>

                <div className="title_div">
                    <span className="sub_title">Cinematic Trailer</span>
                    <span className="title">Video Production <br></br>and Post Production</span>
                </div>




            </div>

            <div className="section_three">
                <img className="line_break" src={`${toAbsoluteUrl(`/media/icons/line.svg`)}`} alt="Image" />
            </div>

            <div className="section_four">
                <div className="row_four">
                    <p>This commercial was completely designed in cinema 4D. Clearly inspired by the fenty original ad, we used modern beats paired with quick cuts. Using 3D animation for commercials provides a unmatched flexibility. Especially when brands release several new models/fragrances/sorts a year. Already existing designed models can be altered and implemented quickly, instead of shooting a whole new ad from scratch. With Intel oktane rendering, the best 3D render in the world, project take a fracture of time they needed in the past. </p>

                </div>

            </div>

            <div className="section_five-2">
                <img className="pic1" src={`${toAbsoluteUrl(`/media/images/projects-img_3.png`)}`} alt="Image" />
                <img className="pic2" src={`${toAbsoluteUrl(`/media/images/projects-img_4.png`)}`} alt="Image" />
            </div>

            <div className="section_six">
                <p className="mb-0">Start today</p>
                <p className="contact_email">{process.env.REACT_APP_EMAIL}</p>
                <img className="img_right" src={`${toAbsoluteUrl('/media/icons/arrow-right.svg')}`} alt="Right" />
            </div>

            <div className="section_seven">
                <span>
                    <Link className="footer-link" to="/">Portfolio</Link>


                    <Link className="footer-link" to="/solutions"> Our Solutions </Link>
                    <Link className="footer-link" to="/agency">   Our Agency</Link>
                    <a href="/" className="anchorFour"><img src={`${toAbsoluteUrl('/media/images/logo_dark.svg')}`} alt={process.env.REACT_APP_NAME} /></a>
                    <Link className="footer-link" to="/contact-us">   Contact</Link>
                    <Link className="footer-link" to="/imprint">  Imprint</Link>
                    <Link className="footer-link" to="/imprint">Datasecure</Link>
                </span>
            </div>
        </div>
    );
}

export default ProjectsTwo;
